pub enum ExportIndex {

    /// Function export.
    Function(FunctionIndex),

    /// Table export.
    Table(TableIndex),

    /// Memory export.
    Memory(MemoryIndex),

    /// Global export.
    Global(GlobalIndex),
}

pub enum ImportIndex {

    /// Function import.
    Function(FunctionIndex),

    /// Table import.
    Table(TableIndex),

    /// Memory import.
    Memory(MemoryIndex),

    /// Global import.
    Global(GlobalIndex),
}

pub enum ExternRef {

    /// A reference to no data.
    Null,

    /// A reference to data stored internally.
    Ref(InternalRef),

    /// A reference to data located outside.
    Other(OtherRef),
}

pub enum Type {

    /// Signed 32 bit integer.
    I32,

    /// Signed 64 bit integer.
    I64,

    /// Floating point 32 bit integer.
    F32,

    /// Floating point 64 bit integer.
    F64,

    /// A 128 bit number.
    V128,

    /// A reference to opaque data in the Wasm instance.
    ExternRef,

    /// A reference to a Wasm function.
    FuncRef,
}

pub enum ExternType {

    /// This external type is the type of a WebAssembly function.
    Function(FunctionType),

    /// This external type is the type of a WebAssembly global.
    Global(GlobalType),

    /// This external type is the type of a WebAssembly table.
    Table(TableType),

    /// This external type is the type of a WebAssembly memory.
    Memory(MemoryType),
}

pub enum Mutability {

    /// The global is constant and its value does not change
    Const,

    /// The value of the global can change over time
    Var,
}

pub enum GlobalInit {

    /// An `i32.const`.
    I32Const(i32),

    /// An `i64.const`.
    I64Const(i64),

    /// An `f32.const`.
    F32Const(f32),

    /// An `f64.const`.
    F64Const(f64),

    /// A `v128.const`.
    V128Const(V128),

    /// A `global.get` of another global.
    GetGlobal(GlobalIndex),

    /// A `ref.null`.
    RefNullConst,

    /// A `ref.func <index>`.
    RefFunc(FunctionIndex),
}

pub enum Value<T> {

    /// A 32-bit integer.
    ///
    /// In Wasm integers are sign-agnostic, i.e. this can either be signed or unsigned.
    I32(i32),

    /// A 64-bit integer.
    ///
    /// In Wasm integers are sign-agnostic, i.e. this can either be signed or unsigned.
    I64(i64),

    /// A 32-bit float.
    F32(f32),

    /// A 64-bit float.
    F64(f64),

    /// An `externref` value which can hold opaque data to the wasm instance itself.
    ///
    /// Note that this is a nullable value as well.
    ExternRef(ExternRef),

    /// A first-class reference to a WebAssembly function.
    FuncRef(T),

    /// A 128-bit number
    V128(u128),
}
